import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.scss';
import Main from './pages/Main';
import Works from './pages/Works';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Main />} />
          <Route path='/works' element={<Works />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
